import React, { useRef } from "react";
import Button from "../Button"

export default function FilterBar(props:{handleClick: any, setError: any, setCharacters: any, setCreators: any}) {
    // let input = useRef(null);
    return (
        <form>
        {/* <input type="text" placeholder="Search hero..." ref={input} /> */}
        <Button
          // text={"Search"}
          handleClick={(e: any) => {
            props.handleClick(e)
              .then((data: any) => props.setCharacters(data.data.results) || props.setCreators(data.data.results))
              .catch((err: any) => props.setError(err));
            }}
        />
      </form>
      );
  }
